using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIInputViewAudioFeedback_ProtocolReference/index.html#//apple_ref/occ/intf/UIInputViewAudioFeedback	/// <summary>	/// The UIInputViewAudioFeedback protocol defines a single property for enabling a custom input or keyboard accessory view to play standard keyboard input clicks.	/// </summary>	[iOSVersion(4.2)]	public interface UIInputViewAudioFeedback	{		/// <summary>		/// Specifies whether or not an input view enables input clicks.		/// </summary>		[iOSVersion(4.2)]		[Export("enableInputClicksWhenVisible")]		[Optional]		bool EnableInputClicksWhenVisible;	}}